using System.Collections.Generic;
using System.Linq;
using ProductApi.Data.Entities;

namespace ProductApi.Data
{
    /// <summary>
    /// Product repository
    /// </summary>
    public class ProductRepository : IProductRepository
    {
        #region Fields

        private readonly List<Product> _products;

        #endregion

        #region Properties

        /// <summary>
        /// Gets a table
        /// </summary>
        public virtual IQueryable<Product> Table
        {
            get
            {
                return this.Products.AsQueryable();
            }
        }

        /// <summary>
        /// Get products
        /// </summary>
        public IList<Product> Products
        {
            get
            {
                return _products;
            }
        }

        #endregion

        #region Ctor

        public ProductRepository()
        {
            _products = new List<Product>()
            {
                new Product() {Id = 1001, Name = "Flip Lavender", Price = 1100, Stock = 10, Image = @"" },
                new Product() {Id = 1002, Name = "Samsung Z Flip", Price = 1200, Stock = 20, Image = @"" },
                new Product() {Id = 1003, Name = "Samsung Galaxy", Price = 1300, Stock = 30, Image = @"" },
                new Product() {Id = 1004, Name = "iPhone 12 Pro", Price = 1400, Stock = 40, Image = @"" },
                new Product() {Id = 1005, Name = "Samsung Fold", Price = 1500, Stock = 50, Image = @"" }                
            };
        }

        #endregion

        #region Methods

        /// <summary>
        /// Get entity by identifier
        /// </summary>
        /// <param name="id">Identifier</param>
        /// <returns>Entity</returns>
        public Product Get(int id)
        {
            return this.Table.FirstOrDefault(x => x.Id == id);
        }

        /// <summary>
        /// Insert entity
        /// </summary>
        /// <param name="entity">Entity</param>
        /// <returns>Identifier</returns>
        public int Insert(Product entity)
        {
            if (entity.Id == default(int)) //only add if id = default(int)
            {
                var lastEntity = this.Table.LastOrDefault();
                    if (lastEntity != null)
                        entity.Id = lastEntity.Id + 1;
                    else
                        entity.Id = 1;

                    this.Products.Add(entity);
            }

            return entity.Id;
        }

        /// <summary>
        /// Update entity
        /// </summary>
        /// <param name="entity">Entity</param>
        public void Update(Product entity)
        {
            var index = this.Products.IndexOf(this.Products.Where(i => i.Id == entity.Id).FirstOrDefault());
            if (index > 0)
            {
                this.Products[index] = entity;
            }
        }

        /// <summary>
        /// Delete entity
        /// </summary>
        /// <param name="entity">Entity</param>
        public void Delete(Product entity)
        {
            if (this.Products.Any(i => i.Id == entity.Id))
            {
                this.Products.Remove(entity);
            }
        }

        #endregion
    }
}
